import React from "react";

export const Tile = (props) => {
  const array = Object.values(props.contact);
  return (
    <div className="tile-container">
      {array.map( (data, index) => 
          <p className="tile-title" key={index}>{data}</p>
        )
      }
    </div>
  );
};

